// n8n Code node — removes HTML tags (including img, script, style, audio, svg), social media links, and tracking from $input.first().json.data

const html = $json.data || "";

// Remove specific tags and their content (script, style, audio, svg)
let cleanHtml = html
  .replace(/<head[^>]*>[\s\S]*?<\/head>/gi, '')
  .replace(/<script[^>]*>[\s\S]*?<\/script>/gi, '')
  .replace(/<noscript[^>]*>[\s\S]*?<\/noscript>/gi, '')
  .replace(/<style[^>]*>[\s\S]*?<\/style>/gi, '')
  .replace(/<header[^>]*>[\s\S]*?<\/header>/gi, '')
  .replace(/<footer[^>]*>[\s\S]*?<\/footer>/gi, '')
  .replace(/<!--[\s\S]*?-->/g, '')
  .replace(/<audio[^>]*>[\s\S]*?<\/audio>/gi, '')
  .replace(/<svg[^>]*>[\s\S]*?<\/svg>/gi, '');

// Remove social media links (e.g., facebook, twitter, instagram, linkedin, youtube)
cleanHtml = cleanHtml.replace(/<a[^>]+href=["']?[^"'>]*?(facebook|twitter|instagram|linkedin|youtube)\.com[^"'>]*["']?[^>]*>[\s\S]*?<\/a>/gi, '');

// Remove known tracking parameters (e.g., utm_*, fbclid, gclid) from all URLs
cleanHtml = cleanHtml.replace(/([?&](utm_[^=]+|fbclid|gclid)=[^&\s#"]*)/gi, '');

// Remove image tags
cleanHtml = cleanHtml.replace(/<img[^>]*>/gi, ''); // Remove img tags (self-closing)

// Strip remaining HTML tags
const plainText = cleanHtml
  .replace(/<[^>]*>/g, '')     // Remove any other tags
  .replace(/\s+/g, ' ')        // Collapse whitespace
  .trim();                     // Trim leading/trailing space

return [{
  json: {
    plainText
  }
}];

const urlArray = $input.first().json.urlset.url;

// Extract loc values from all URLs
let locs = [];

if (Array.isArray(urlArray)) {
  urlArray.forEach(entry => {
    if (entry.loc) {
          locs.push({
            'url': entry.loc
          });
    }
  });
}

//const locsSubset = locs.slice(1, 3);
//return locsSubset.map(url => (url));

return locs.map(url => (url));

// Get the Title from the first input item
let title = $input.first().json.Title || "";

// Remove all special characters (keep letters, numbers, and spaces)
title = title.replace(/[^a-zA-Z0-9 ]/g, "");

// Return the modified title
return {
  json: {
    CleanTitle: title,
    content: $input.first().json.Content
  }
};
